(543, 'https://www.ces.tech/Topics/Robotics-Machine-Intelligence/Space-Technology', '\r	Space Technology - CES 2022\r', 'The technology that makes space exploration possible has an out-of-this-world influence on Earth too. Explore the breakthrough advances guiding everything from life and discovery on Mars and the moon to weather forecasting, satellite systems and long-distance communications at home.', 'International CES, CES, CES 2010, CES 2011, CES 2012, CES 2013, CES 2014, CES 2015, CES 2016, CES 2017, CES 2018, Consumer Electronics Show, Consumer Technology, Consumer Electronics, Consumer Electronics Association, CES Las Vegas, ces show, ces vegas, CES Unveiled, ces tradeshow, ces conference, ces registration, ces exhibitor, ces innovation awards, innovation awards, best of ces, ces keynote, ces show floor, technology, silicon valley, technology innovation, disruptive technology, start-ups,CES, consume', 0),
