(545, 'https://www.ces.tech/Topics/Sports/eSports', '\r	Esports - CES 2022\r', 'Powered by increased access to the internet, gaming platforms and streaming services, esports is experiencing rapid growth. Get a glimpse into the technology that’s opening esports up to amateurs and passive viewers as you hear from experts on the future of esports and fan engagement.', 'International CES, CES, CES 2010, CES 2011, CES 2012, CES 2013, CES 2014, CES 2015, CES 2016, CES 2017, CES 2018, Consumer Electronics Show, Consumer Technology, Consumer Electronics, Consumer Electronics Association, CES Las Vegas, ces show, ces vegas, CES Unveiled, ces tradeshow, ces conference, ces registration, ces exhibitor, ces innovation awards, innovation awards, best of ces, ces keynote, ces show floor, technology, silicon valley, technology innovation, disruptive technology, start-ups,CES, consume', 0),
